import React from 'react';
import './styles/App.scss';
import Game from './components/Game';

function App() {
  return (
    <div className="App">
      <h1>La Batata</h1>
      <img src="./assets/la-batata.png"/>
      <Game />
    </div>
  );
}

export default App;
